import React, {useEffect, useState} from "react";
import {useParams} from "react-router-dom";
import {navigator} from "../utils";

function Map() {
    const  [map,setMap] = useState([])
    const { uuid } = useParams()

    useEffect(() => {
        fetch('https://valorant-api.com/v1/maps/'+uuid).then(x => x.json()).then(res => setMap(res.data))

        if (map.uuid !== uuid) {
            navigator('/maps')
        }
    }, [uuid])

    return (<>
        { uuid }

    </>)
}

export default Map
